import { useEffect } from "react";

import React from 'react'

const Phot = () => {

useEffect(() => {
  const Phots = fetch("https://jsonplaceholder.typicode.com/photos/")
    .then((response) => response.json())
    .then((per) => per);
}, []);

  return (
   <p>{per}</p> 
  )
}

export default Phot
